fn add_test_fp6(){
    for i in 0..25{
    assert_eq!(T1_fp6[i]+T2_fp6[i],SUM_fp6[i]);
    }
} 
#[test]
fn addassigntest_fp6(){
    for i in 0..25{
    let mut a=T1_fp6[i];
    a+=T2_fp6[i];
    assert_eq!(a,SUM_fp6[i])
    }
}
#[test]
fn sub_test_fp6(){
    for i in 0..25{
        assert_eq!((T1_fp6[i]-T2_fp6[i]),DIFF_fp6[i]);
        assert_eq!(SUM_fp6[i]-T1_fp6[i],T2_fp6[i]);
        assert_eq!(SUM_fp6[i]-T2_fp6[i],T1_fp6[i]);
    }
}
#[test]
fn subassigntest_fp6(){
        for i in 0..25{
            let mut a=T1_fp6[i];
            a-=T2_fp6[i];
            assert_eq!(a,DIFF_fp6[i])
            }
}
