fn negtraittest_fp6(){
    for i in 0..25{
        assert_eq!(-T1_fp6[i],Fp6::ZERO-T1_fp6[i]);
        assert_eq!(-T2_fp6[i],Fp6::ZERO-T2_fp6[i]);
    }
}
