#[test]
fn iszerotest_fp6(){
    assert_eq!((Fp6::<Fp>::ZERO).is_zero(),true);
    assert_eq!((Fp6::<Fp>::ONE).is_zero(),false);
    assert_eq!((Fp6::<Fp>::from(50u32)).is_zero(),false);
}
#[test]
fn isonetest_fp6(){
    assert_eq!((Fp6::<Fp>::ONE).is_one(),true);
    assert_eq!((Fp6::<Fp>::ZERO).is_one(),false);
    assert_eq!((Fp6::<Fp>::from(50u32)).is_one(),false);
}
#[test]
fn doubletest_fp6(){
    // we want two in montgomery form using new 
    let two=Fp6 { c0: Fp2 { c0: Fp::new(U384::from(2u8)), c1: Fp::new(U384::from(0u8)) },
         c1: Fp2::ZERO ,
          c2: Fp2::ZERO   };
    for i in 0..25{
       assert_eq!(T1M_fp6[i].double(),T1M_fp6[i]*two);
       assert_eq!(T2M_fp6[i].double(),T2M_fp6[i]*two);
      }
}
#[test]
fn tripletest_fp6(){
    // we want three in montgomery form
    let three=Fp6 { c0: Fp2 { c0: Fp::new(U384::from(3u8)), c1: Fp::ZERO },
         c1: Fp2::ZERO,
          c2: Fp2::ZERO } ;
    for i in 0..25{
       assert_eq!(T1M_fp6[i].triple(),T1M_fp6[i]*three);
       assert_eq!(T2M_fp6[i].triple(),T2M_fp6[i]*three);
      }
}

