#[test]
fn exptest_fp12(){
    let  x=Fp::from(50u8);
    let xx=x.0.as_words();
    let mut res:Vec<Fp12<Fp>>=Vec::new();
    for i in 0..25{
        let mut a=Fp12{c0:Fp6 { c0: Fp2 { c0: Fp(R), c1:  Fp::ZERO}, c1: Fp2::ZERO, c2: Fp2::ZERO },
                             c1:Fp6::ZERO};
        for j in 0..50{
            a*=T1M_fp12[i];
        }
        res.push(a)
    }
    for i in 0..25{
        assert_eq!(T1M_fp12[i].power_by(xx),res[i]);
    }
}
