mod jubtest{
    use crypto_bigint::U256;
    use traits::traits::{Field, PrimeField};
    pub const TWO_ADIC_ROOT: U256 = U256::from_be_hex("0e7db4ea6533afa906673b0101343b00a6682093ccc81082d0970e5ed6f72cb6");

    use crate::{jubjub_scalar::JubScalar, test::{JUBLIST1, JUBLIST2, JUBLISTSUM, JUBLISTSUB, JUBLISTMUL, JUBLIST1INV, JUBEXP} };


    #[test]
    fn jubadd_test(){
    for i in 0..50{
        assert_eq!(JUBLIST1[i]+JUBLIST2[i],JUBLISTSUM[i]);
        }
    }
    #[test]
    fn jubaddassign_test(){
    for i in 0..50{
        let mut a= JUBLIST1[i];
        a+= JUBLIST2[i];
        assert_eq!(JUBLIST1[i]+JUBLIST2[i],a);
        }
    }
    #[test]
    fn jubscalarsqrt(){
        for i in 0..1{
            let a = JUBLIST1[i].square();
            assert_eq!(a.sqrt().unwrap(),JUBLIST1[i])

        }
    }

    #[test]
    fn jubsub_test(){
    for i in 0..50{
        assert_eq!(JUBLIST1[i]-JUBLIST2[i],JUBLISTSUB[i]);
        }
    }

    #[test]
    fn jubsubassign_test(){
    for i in 0..50{
        let mut a= JUBLIST1[i];
        a-= JUBLIST2[i];
        assert_eq!(JUBLIST1[i]-JUBLIST2[i],a);
        }
    }

    #[test]
    fn jubmul_test(){
        for i in 0..50{
            assert_eq!(JUBLIST1[i]*JUBLIST2[i],JUBLISTMUL[i]);
            }
    }

    #[test]
    fn jubmulassign_test(){
    for i in 0..50{
        let mut a= JUBLIST1[i];
        a*= JUBLIST2[i];
        assert_eq!(JUBLIST1[i]*JUBLIST2[i],a);
        }
    }

    #[test]
    fn jubnegtest(){
        for i in 0..50{
            let a=-JUBLIST1[i];
            assert_eq!(JubScalar::ZERO-JUBLIST1[i],a);
        }
    }
    #[test]
    fn jubinv_test(){
        for i in 0..50{
            assert_eq!(JUBLIST1[i].invert().unwrap(),JUBLIST1INV[i]);
        }
    }
    #[test]
    fn jubexp_test(){
        for i in 0..50{
            let p= JUBLIST2[i];
            let pp= p.0.as_words();
            assert_eq!(JUBLIST1[i].power_by(pp),JUBEXP[i]);
        }
    }

    #[test]
    fn jubsq_test(){
        for i in 0..50{
            assert_eq!(JUBLIST1[i].square(),JUBLIST1[i]*JUBLIST1[i]);
            assert_eq!(JUBLIST2[i].square(),JUBLIST2[i]*JUBLIST2[i]);
        }
    }

    #[test]
    fn jubcube_test(){
        for i in 0..50{
            assert_eq!(JUBLIST1[i].cube(),JUBLIST1[i]*JUBLIST1[i]*JUBLIST1[i]);
            assert_eq!(JUBLIST2[i].cube(),JUBLIST2[i]*JUBLIST2[i]*JUBLIST2[i]);
        }
    }

    #[test]
    fn jubdouble_test(){
        for i in 0..50{
            assert_eq!(JUBLIST1[i].double(),JUBLIST1[i]+JUBLIST1[i]);
            assert_eq!(JUBLIST2[i].double(),JUBLIST2[i]+JUBLIST2[i]);
        }
    }

    #[test]
    fn jubtriple_test(){
        for i in 0..50{
            assert_eq!(JUBLIST1[i].triple(),JUBLIST1[i]+JUBLIST1[i]+JUBLIST1[i]);
            assert_eq!(JUBLIST2[i].triple(),JUBLIST2[i]+JUBLIST2[i]+JUBLIST2[i]);
        }
    }
    #[test]
    fn jub_scalarrootofunity(){
        for i in 1..2{  //checks for upto 2^1 th root
        let a1=JubScalar::get_root_of_unity(i);
        println!("2^{i} th root of unity is {:?}",a1);
        assert_eq!(a1,JubScalar(TWO_ADIC_ROOT));
        }
    }

    #[test]
    #[should_panic]
    fn jub_scalarnonexistingrootunity(){
        let i=2; //works for i>2
        let a1=JubScalar::get_root_of_unity(i);
    }


}


