/// courtesy govind
#[cfg(test)]
mod bandtest {
    pub const SCALAR_MODULUS_1: BandScalar = BandScalar(
        U256::from_be_hex("1CFB69D4CA675F520CCE760202687600FF8F87007419047174FD06B52876E7E0")
    );
    use crate::bandersnatch_scalar::{BandScalar,add as sadd, div as sdiv, mul as smul, BANDSCALAR_MODULUS};
    use crate::fp::{Fp, R, MODULUS};
    use crate::jubjub_scalar::JubScalar;
    use crate::scalar::{Scalar, SCALAR_MODULUS};
    use crypto_bigint::U256;
    use traits::traits::{Field};
    use traits::traits::PrimeField;

    //is odd
    #[test]
    fn s_is_odd() {
        let b = BandScalar::triple(BandScalar::ONE);
        let c = BandScalar::is_odd(b);
        assert_eq!(true, bool::from(c));
    }

    //exp
    #[test]
    fn sexptest() {
        //exponent
        for _ in 0..50 {
            let a = BandScalar::new(U256::from_u8(0)); // a                                      
            let b = BandScalar::new(U256::from_u8(3)); // 3
            let b2 = BandScalar::new(U256::from_u8(4)); // 3
            let b3 = SCALAR_MODULUS_1;
            let bb = b.0.to_words();
            let bb2 = b2.0.to_words();
            let bb3 = b3.0.to_words();
            let bb4 = a.0.to_words();

            assert_eq!(BandScalar::power_by(a, &bb4), BandScalar::ONE)
        }
    }

    //invert
    #[test]
    fn sinverse() {
        for _ in 0..9 {
            let a = BandScalar::random();
            assert_eq!(smul(a, <BandScalar as Field>::invert(a).unwrap()), BandScalar::ONE);
        }
    }
    #[test]
    fn sqcheck(){
        for _ in 0..50{
        let a = BandScalar::random();
        assert_eq!(a*a, a.square())
        }
    }
    #[test]
    fn bandsqrt_check(){
        for _ in 0..1000{
            let a=BandScalar::random();
            let b=a.square();
            let c=b.sqrt().unwrap().square();
            assert_eq!(b,c);
        }
    }
    #[test]
    fn jubsqrt_check(){
        for _ in 0..1000{
            let a=JubScalar::random();
            let b=a.square();
            let c=b.sqrt().unwrap().square();
            assert_eq!(b,c);
        }
    }

    #[test]
    fn printone(){
        println!("{:?}",(Fp::ONE.to_montgomery())*((Fp::ONE.to_montgomery())));
        println!("{:?}",Fp(R));
    }

    #[test]
    fn check_power_by(){
        let a=BandScalar::random();
        assert_eq!(a.power_by(U256::from(2u32).to_words()),a.square())
    }
    #[test]
    fn random_fn_check(){
        for _ in 0..(1<<10){
            let a = Fp::random();
            let b = Scalar::random();
            let c = BandScalar::random();
            if (a < Fp(MODULUS)) & (b < Scalar(SCALAR_MODULUS)) & (c< BandScalar(BANDSCALAR_MODULUS)){
                println!("random is working fine")
            }
            else{
                panic!()
            }
           
        }
    }
}
